function getWorks(id) {

  console.log('id: ' + id);
  var worksArr = '';

  var begin = bigDictionary[id].indexOf('Работы входящие в стоимость:') + 1;
  var end = bigDictionary[id].indexOf('Материалы, входящие в стоимость Купона:') - 1;
  worksArr = bigDictionary[id].slice(begin, end);

  return worksArr;
}

function getMaterials(id) {
  var materials = [];

  var begin = bigDictionary[id].indexOf('Материалы, входящие в стоимость Купона:') + 1;
  var end = bigDictionary[id].indexOf('В стоимость подключения не входит:') - 1;
  materials = bigDictionary[id].slice(begin, end).filter(function (item) {
    return Boolean(item);
  }).map(function (item, i) {
    console.log(item);
    return ' ' + item;
  });

  return materials;
}

function worksNotInclude(id) {

  var works = [];

  var begin = bigDictionary[id].indexOf('В стоимость подключения не входит:') + 1;
  var end = bigDictionary[id].indexOf('Дополнительная информация:') - 1;
  works = bigDictionary[id].slice(begin, end).filter(function (item) {
    return Boolean(item);
  }).map(function (item, i) {
    console.log(item);
    return ' ' + item;
  });

  return works;
}

function returnSpacesUnderline(number, fullname) {
  var spacesUnderline = '';
  for (var i = 1; i < number; i++) {
    spacesUnderline += ' ';
  }
  return fullname ? fullname : { text: spacesUnderline, decoration: 'underline' };
}

function getInfoText(id) {
  return bigDictionary[id][0];
}

function getAdditionalInfo(id) {
  var additionalInfo = '';
  var begin = bigDictionary[id].indexOf('Дополнительная информация:') + 1;
  var end = bigDictionary[id].indexOf('LAST LINE') - 1;

  additionalInfo = bigDictionary[id].slice(begin, end);

  return additionalInfo;
}

